import React from "react";

interface TodoItemProps {
  todo: Todo;
}

export const TodoItem: React.FunctionComponent<TodoItemProps> = ({ todo }) => {
  return (
    <li>
      <label
        style={{
          textDecoration: todo.completedStatus
            ? (className = "completed")
            : "none",
        }}
      >
        <input type="checkbox" checked={todo.completedStatus} />
        {todo.text}
      </label>
    </li>
  );
};
